                if "location" in detail and "country" in details[i + 1]:
                    country_name = details[i + 1].split("is located in ")[1] if "is located in " in details[i + 1] else details[i + 1].split("country ")[1]
                    location_name = detail.split("is located in ")[1] if "is located in " in detail else detail.split("location ")[1]
                    combined_detail = f"{location_name}, which is in {country_name}"
                    combined_details.append(combined_detail)
                    i += 2
                    continue

                if "country" in detail and "capital" in details[i + 1]:
                    country_name = detail.split("is located in ")[1] if "is located in " in detail else detail.split("country ")[1]
                    capital_name = details[i + 1].split("capital ")[1]
                    combined_detail = f"{country_name}, where the capital is {capital_name}"
                    combined_details.append(combined_detail)
                    i += 2
                    continue

                if "location" in detail and "country" in details[i + 1] and "capital" in details[i + 2]:
                    location_name = detail.split("is located in ")[1] if "is located in " in detail else detail.split("location ")[1]
                    country_name = details[i + 1].split("is located in ")[1] if "is located in " in details[i + 1] else details[i + 1].split("country ")[1]
                    capital_name = details[i + 2].split("capital ")[1]
                    combined_detail = f"{location_name}, which is in {country_name}, where the capital is {capital_name}"
                    combined_details.append(combined_detail)
                    i += 3
                    continue
            combined_details.append(detail)
            i += 1
        sentence = ", ".join(combined_details) + "."

    return sentence

